# Taschenrechner Web-App

Eine einfache, voll funktionsfaehige Taschenrechner-Webanwendung mit Historie und Dark Mode.

## Features

- **Grundrechenarten**: Addition, Subtraktion, Multiplikation, Division
- **Fehlerbehandlung**: Division durch 0 zeigt "Error"
- **Zusatzfunktionen**: 
  - C (Clear) - alles zuruecksetzen
  - ‚Üê (Backspace) - letztes Zeichen loeschen
- **Berechnungshistorie**: Letzte 5 Berechnungen anzeigen
- **Dark Mode**: Umschaltbar zwischen Hell- und Dunkelmodus

## Starten der Anwendung

### Windows
```
run.bat
```

Oder einfach die `calculator.html` im Browser oeffnen.

## Tests ausfuehren

```bash
# Playwright installieren (einmalig)
playwright install

# Tests starten
pytest tests/
```

## Struktur

```
calculator.html    # Hauptanwendung (HTML/CSS/JS)
run.bat            # Start-Skript fuer Windows
tests/             # Playwright UI-Tests
